import {Link } from 'react-router-dom';
import React from 'react';
import './navBar.css';
import homeicon from'./plant.png'
function navBar() {
    return (
        <div className="nav">
        <Link to="/" type="img" src={homeicon}><img src={homeicon} alt="Home" height="30px" width="30px"></img></Link>
        <Link to="/get-started" className="text nv">Get started</Link>
        <Link to="/about-us" className="text nv">About-Us</Link>
        </div >
    )
}
export default navBar
